Pronti a brindare? 🥂
Quest'anno per il #PremioIgersItalia2019 abbiamo fatto le cose in grande. Non uno, ma due appuntamenti assolutamente da non perdere. 
Accolti dalle community di @igers.roma e @igers_lazio, vi aspettiamo all'IgersItalia XMasMeet:
• Venerdì 20 dicembre - Cena di Gala "Premio Nazionale IgersItalia" a Residenza di Ripetta.
• Sabato 21 dicembre - Empty Museum in occasione dell'anniversario dei "Vent'anni di Scuderie del Quirinale".
Per saperne di più cerca il link in bio e prenota il tuo biglietto: https://xmasmeet2019.eventbrite.it
La registrazione è obbligatoria per partecipare all'evento.
Ci vediamo a Roma per vivere insieme questa nuova e splendida experience!
