Anche la pioggia 🌧 ha i suoi lati romantici, stare stretti stretti, sotto lo stesso ombrello ☔ per scappare insieme a trovare un riparo... Ecco come sentirsi in un film di #WoodyAllen.
Da Roma a Milano, da Matera a Siena, da Agrigento a Firenze e da Napoli a Alberobello, l'ombrello rosso di #UnGiornoDiPioggiaANewYork ha tenuto al riparo tante coppie d'innamorati.
Non senti anche tu l'incantesimo dell'amore nell'aria? 💘
•
#Igersitalia è media partner di @luckyred per “Un giorno di pioggia a New York”, la commedia romantica ambientata a Manhattan e racconta la storia di due innamorati, Gatsby interpretato da Timothée Chalamet e Ashleigh, la bellissima Elle Fanning, i cui piani per un weekend romantico da trascorrere insieme vanno in fumo non appena mettono piede in città.
Da questa sera al cinema.
